import logo from './logo.svg';
import './App.css';
import React from "react";
import Joke from './Component./Joke'



function App() {
  return (
    <div>
      <Joke
        question = "how do you like it?"
        punchline = "hahaha"
      />
      <Joke
        question = "2 ?"
        punchline = "2 !"
      />
      <Joke
        question = "3 ?"
        punchline = "3 !"
      />

    </div>
  );
}

export default App;
